def pig_latin(sentence):
    vowels = ['a', 'e', 'i', 'o', 'u']
    words = sentence.split()
    pig_latin_sentence = ""

    for word in words:
        if word[0].lower() in vowels:
            pig_latin_word = word + 'way '
        else:
            pig_latin_word = word[1:] + word[0] + 'ay '
        pig_latin_sentence += pig_latin_word

    return pig_latin_sentence.rstrip()
